function HoneyTypeUsers() {
	HoneyPuros.apply(this, [$("#btn_cretuser"), $("#btn_uptuser"), $("#btn_deltuser"), $('<tbody></tbody>').attr('id', 'tbody_tuser'), $("#modal-edittuser"), $("#tabletuser"), 'Sml_Tipo', 'Vch_Tipo', 'ttuser' ]);
	var Clave = $("#clv_tuser"), Tipo = $("#t_user"), token = $("#token_tipouser").val(), that = this;

	that.btn1.click(function(){
		that.Route = "/TUser/";
		that.Types = "POST";
		that.Datos = { Sml_Tipo : Clave.val(), Vch_Tipo : Tipo.val(), TipoCrud: 'Insertar' };
		that.Ajax(token);
	});

	that.btn2.click(function(){
		that.Route = "/TUser/"+Clave.val()+"";
		that.Types = "PUT";
		that.Datos = { Sml_Tipo : Clave.val(), Vch_Tipo : Tipo.val(), TipoCrud: 'Actualizar' };
		that.Ajax(token);
	});

	that.btn3.click(function(){
		that.Route = "/TUser/"+Clave.val()+"";
		that.Types = "DELETE";
		that.Datos = { Sml_Tipo : Clave.val(), Vch_Tipo : Tipo.val(), TipoCrud: 'Eliminar' };
		that.Ajax(token);
	});	

	$(document).on('click', '.pagination a', function(e){
		e.preventDefault();
		that.page = $(this).attr('href').split('page=')[1];
		that.Route = "/TUser";
		that.Pagination();
	});

	$("#btn_newtuser").click(function(){ that.Modal(this, 1) });

	$(document).on('click', '#btn_editpuro', function(e){
		e.preventDefault();
		that.Route = "/TUser/"+this.value+"/edit";
		that.Types = "GET";
		that.Modal(this, 2);	
	});

	$(document).on('click', '#btn_deltpuro', function(e){
		e.preventDefault();
		that.Route = "/TUser/"+this.value+"/edit";
		that.Types = "GET";
		that.Modal(this, 3);
	});

	that.CargaTabla = function(value){
		that.tabla.empty();
		that.Route = "/TUser";
		$.get(that.Route, function(response){
			if(value == 1) { that.CargaDatosTabla(); }
			else{ that.CargaDatosTabla(1, response); }	
		});
	}

	that.LlenaModal = function(response){
		$(response).each(function(){
			Clave.val(this.Sml_Tipo);
			Tipo.val(this.Vch_Tipo);
		});
		$(that.Modall).modal('show');	
	}
}

HoneyTypeUsers.prototype = HoneyPuros;
var ht = new HoneyTypeUsers();

$(document).ready(function(){
	ht.Route = "/TUser";
	ht.CargaTabla(1);	
});
